import React from "react";
import { useSelector } from "react-redux";
import { RootStateType, store } from "../store/TodoRedux";
import TodoList from "../List/TodoList";
import "./stye.scss";

function Container() {
	const todo = useSelector((state: RootStateType) => state.todo).list;

	return (
		<div className="container">
			<TodoList todo={todo} />
		</div>
	);
}

export default Container;
